import React from "react";
import "./App.css";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <main className="main-content">
        <h1>Welcome to Moleclear</h1>
      </main>
    </div>
  );
}

export default App;
